const Testimonials = () => {
  const testimonials = [
    {
      name: 'Sarah Johnson',
      position: 'CEO, TechStart',
      content: 'John delivered an exceptional website that exceeded our expectations. His attention to detail and technical expertise is outstanding.',
      avatar: 'SJ'
    },
    {
      name: 'Mike Chen',
      position: 'CTO, InnovateCorp',
      content: 'Working with John was a pleasure. He brought our vision to life with clean code and modern design principles.',
      avatar: 'MC'
    },
    {
      name: 'Emma Davis',
      position: 'Marketing Director',
      content: 'Professional, reliable, and incredibly talented. John helped us create a digital presence that truly represents our brand.',
      avatar: 'ED'
    }
  ];

  return (
    <section id="testimonials" className="section-padding" role="region" aria-labelledby="testimonials-title">
      <div className="container">
        <h2 id="testimonials-title" className="section-title h1">What Clients Say</h2>
        <div className="row g-4">
          {testimonials.map((testimonial, index) => (
            <div className="col-lg-4 col-md-6" key={index} data-aos="fade-up" data-aos-delay={index * 100}>
              <article className="testimonial-card">
                <div className="testimonial-avatar">{testimonial.avatar}</div>
                <blockquote className="mb-3">
                  <i className="fas fa-quote-left text-primary me-2" aria-hidden="true"></i>
                  {testimonial.content}
                  <i className="fas fa-quote-right text-primary ms-2" aria-hidden="true"></i>
                </blockquote>
                <cite className="d-block">
                  <strong>{testimonial.name}</strong>
                  <div className="text-muted small">{testimonial.position}</div>
                </cite>
              </article>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};
export default Testimonials;
